import React from 'react';

const Home = () => {
    return (
        <div id="home">
            <h1>Welcome to Stranger's Things: A place to buy and sell gently used items!</h1>
           <br></br> 
            <h3> New to Stranger's Things?</h3>
            <button>
                Register Here!
            </button>
        </div>
    )
}

export default Home;
